import React from 'react';

const SignUp = () => {
return (
	<div>
	<h1>Sign Up</h1>
	<label for="uname">User name</label>
	<input type="text" id="uname" name="unameval"/><br/><br/> 

	<label for="pwd">Password</label>
	<input type="text" id="pwd" name="pwdval"/> 
	</div>
);
};

export default SignUp;
